import React, { Component } from "react";
import Button from "react-bootstrap/Button";

class Activitydetails extends Component {
  render() {
    const options = [
      {
        firstOptions: "First",
      },
      {
        secondOptions: "First",
      },
      {
        thirdOptions: "First",
      },
      {
        fourthOptions: "First",
      },
    ];

    const renderIssues = ({ options }) => {
      options.map((issues) => {
        <ul>
          return <li>{issues}</li>;
        </ul>;
      });
    };

    const Incorrectinfo = () => {
      return (
        <>
          <div className="chat-thread-right">
            <p>No, it looks incorrect</p>
          </div>
          <div className="chat-thread-left">
            <p>
              Please help us understand your concern by selecting your issue
            </p>
            <renderIssues />;
          </div>
        </>
      );
    };
    return (
      <>
        <div className="chat-thread-left">
          <p>Do the details of activity points looks correct to you?</p>
          <div className="button-wrapper">
            <Button>No</Button>
            <Button>Yes</Button>
          </div>
        </div>
        <Incorrectinfo />
      </>
    );
  }
}

export default Activitydetails;
